// src/pages/MentionsLegales.js
import React from 'react';

const MentionsLegales = () => {
  return (
    <div className="page-container">
      <h1>Mentions légales</h1>
      <div className="content-card">
        <p>
          Ce site est développé à des fins éducatives et de démonstration.
        </p>
        <p>
          EuroMillions App n'est pas affilié à la Française des Jeux (FDJ) ni à aucun opérateur officiel de loterie.
        </p>
        <p>
          Les informations fournies sur ce site sont à titre indicatif uniquement et ne constituent pas des conseils financiers ou des garanties de gain.
        </p>
      </div>
    </div>
  );
};

export default MentionsLegales;
